import React, { Component } from 'react';
import axios from 'axios';

export class PayrollEmployeeList extends Component {
  static displayName = PayrollEmployeeList.name;
  static model = { 
    employee: { 
      Id: 0,
      FirstName: "", 
      LastName: ""}, 
    employeeDependents: [
      { 
        Id: 0, 
        FirstName: "",
         LastName: "" },
     ] 
  }
  
  // eslint-disable-next-line no-useless-constructor
  constructor (props) {
    super(props);
  }
  
  New () {
    let config = {
      headers: {
        'Access-Control-Allow-Origin' : '*',
        'contentType': 'application/json',
      }
    }

    axios
    .post("http://localhost:52688/Payroll/Employee/Get", config)
    .then(data => 
      { 
        console.log(data);
        //let test = data.employeeDependents.map(dependents =>
//          <li>{dependents}</li>
        //);
        document.getElementById("TotalBenfitsCost").innerHTML = "$" + data.data;
      })
    .catch(error => console.log(error));
  }
  
  render () {
    return (
      <div id="test">
          <h2>Employee List</h2>
          <br></br><br></br>

          <input type="button" value="New" title="Add New Employee" className="btn-primary" onClick={this.New}></input>
          <br></br>
      </div>
    );
  }
}
